#GoProForACause partner @theoceancleanup is on a mission to put themselves out of business by ridding our oceans of harmful plastics 🌎 For the last decade, they’ve been ideating + developing state-of-the-art systems to both remove existing ocean-rubbish + stop the harmful flow of pollution from major rivers. Now, with tangible proof of concept of their systems, @theoceancleanup has set a target of removing 90% of ocean plastics by the year 2040 💪

